--************************************************************
-- Warehouses - Kuehne & Nagel
--************************************************************
DECLARE @ADDRESSID_1_1   INT
DECLARE @NAME_1_1        NVARCHAR(100)
DECLARE @ACTIVE_1_1      BIT

DECLARE @ADDRESS1_1_1   NVARCHAR(500)
DECLARE @CITY_1_1       NVARCHAR(500)
DECLARE @COUNTRY_1_1    NVARCHAR(500)
DECLARE @STATE_1_1      NVARCHAR(500)
DECLARE @POSTALCODE_1_1 NVARCHAR(500)

DECLARE @COUNTRYID_1_1 INT
DECLARE @STATEPROVINCEID_1_1 INT

SET @NAME_1_1       = 'Kuehne & Nagel'
SET @ADDRESS1_1_1   = '2555 USA Parkway, #104'
SET @CITY_1_1       = 'McCarran'
SET @COUNTRY_1_1    = 'United States'
SET @STATE_1_1      = 'NV'
SET @POSTALCODE_1_1 = '89434'

IF NOT EXISTS (SELECT * FROM Warehouses WHERE Name = @NAME_1_1)
BEGIN

	PRINT 'INSERTING WAREHOUSE - ' + @NAME_1_1

	SET @COUNTRYID_1_1 = (SELECT TOP 1 CountryID FROM Countries WHERE Name = @COUNTRY_1_1)
	SET @STATEPROVINCEID_1_1 = (SELECT TOP 1 StateProvinceID FROM StateProvinces WHERE CountryID = @COUNTRYID_1_1 AND StateAbbreviation = @STATE_1_1)
		
	INSERT INTO Addresses (Address1, AddressTypeID, City, CountryID, StateProvinceID, PostalCode, IsDefault) 
	VALUES (@ADDRESS1_1_1, (SELECT TOP 1 AddressTypeID FROM AddressTypes WHERE Name = 'Warehouse'), @CITY_1_1, @COUNTRYID_1_1, @STATEPROVINCEID_1_1, @POSTALCODE_1_1, 1)
		
	SET @ADDRESSID_1_1 = SCOPE_IDENTITY()
	
	INSERT INTO Warehouses (AddressID, Name, Description, Active) 
	VALUES (@ADDRESSID_1_1, @NAME_1_1, @NAME_1_1, 1)
	
END
ELSE
BEGIN
	
	PRINT 'ALREADY INSERTED    - ' + @NAME_1_1

END


