--************************************************************
-- Shipping Method - FEDEX Ground - BA
--************************************************************
DECLARE @NAME_3_1 NVARCHAR(500)
DECLARE @DESCRIPTION_3_1 NVARCHAR(500)
DECLARE @SHORTNAME_3_1 NVARCHAR(500)
DECLARE @PRIORITY_3_1 INT
DECLARE @ACCEPTPOBOXES_3_1 BIT
DECLARE @ISWILLCALL_3_1 BIT
DECLARE @TRACKINGURL_3_1 NVARCHAR(500)
DECLARE @DESCRIPTIONTRANSLATIONSID_3_1 INT
DECLARE @SHIPPINGMETHODID_3_1 INT

SET @NAME_3_1 = 'FEDEX Ground - BA'
SET @DESCRIPTION_3_1 = 'BA Ground '
SET @SHORTNAME_3_1 = 'FEDEX'
SET @PRIORITY_3_1 = 0
SET @ACCEPTPOBOXES_3_1 = 0
SET @ISWILLCALL_3_1 = 0
SET @TRACKINGURL_3_1 = ''

IF NOT EXISTS (SELECT * FROM ShippingMethods WHERE Name = @NAME_3_1)
BEGIN

	PRINT 'INSERTING SHIPPING METHOD - ' + @NAME_3_1

	INSERT INTO DescriptionTranslations (LanguageID, Name, ShortDescription, LongDescription) 
	VALUES ((SELECT TOP 1 LanguageID FROM Languages WHERE Name = 'English'), @NAME_3_1, @DESCRIPTION_3_1,  @DESCRIPTION_3_1)
		
	SET @DESCRIPTIONTRANSLATIONSID_3_1 = SCOPE_IDENTITY()

	INSERT INTO ShippingMethods (Name, ShortName, Active, IsWillCall, SortIndex, TrackingNumberBaseUrl) 
	VALUES (@NAME_3_1, @SHORTNAME_3_1, 1, @ISWILLCALL_3_1, @PRIORITY_3_1, @TRACKINGURL_3_1)
	
	SET @SHIPPINGMETHODID_3_1  = SCOPE_IDENTITY()

	INSERT INTO ShippingMethodTranslations (ShippingMethodID, DescriptionTranslationID)	
	VALUES (@SHIPPINGMETHODID_3_1, @DESCRIPTIONTRANSLATIONSID_3_1)

END
ELSE
BEGIN
	
	PRINT 'ALREADY INSERTED          - ' + @NAME_3_1

END


